require 'crawler_rocks'
require 'json'
require 'pry'

require 'thread'
require 'thwait'

class KuasCourseCrawler

  def initialize year: current_year, term: current_term, update_progress: nil, after_each: nil, params: nil

    @year = params && params["year"].to_i || year
    @term = params && params["term"].to_i || term
    @update_progress_proc = update_progress
    @after_each_proc = after_each

  end

  def courses detail: false
    @courses = []
    @threads = []

    url = "http://cmap.kuas.edu.tw/CMAP/CMP005m.aspx"

    ###
    __VIEWSTATE = ""
    __EVENTVALIDATION = ""
    ###

    r = RestClient.post(url, {
      "ctl00$ContentPlaceHolder1$DropDownListDDLYms" => "#{@year-1911}-#{@term}",
      "ctl00$ContentPlaceHolder1$DropDownListDegree" => "ALL",
      "ctl00$ContentPlaceHolder1$DropDownListUnit" => "ALL",
      "ctl00$ContentPlaceHolder1$DropDownListMso" => "ALL",
      "ctl00$ContentPlaceHolder1$ButtonQuery" => "搜尋",
      "ctl00$ContentPlaceHolder1$HiddenFieldQuery" => "false",
      "__VIEWSTATE" => __VIEWSTATE,
      "__EVENTVALIDATION" => __EVENTVALIDATION,
      } )
    doc = Nokogiri::HTML(r)

    table = doc.css('table')[10]

    rows = table.css('tr:not(:first-child)')
    rows.each do |row|
      table_datas = row.css('td')

      course = {
        year: @year,
        term: @term,
        code: table_datas[1].text,
        name: table_datas[2].text,
        required: table_datas[3].text,
        credits: table_datas[4].text,
        department: table_datas[5].text,
        lectorer: table_datas[6].text,
      }
      @courses << course
    end

    ThreadsWait.all_waits(*@threads)

    @courses.uniq!

    @threads = []
    @courses.each {|course|
      sleep(1) until (
        @threads.delete_if { |t| !t.status };  # remove dead (ended) threads
        @threads.count < ( (ENV['MAX_THREADS'] && ENV['MAX_THREADS'].to_i) || 20)
      )
      @threads << Thread.new do
        @after_each_proc.call(course: course) if @after_each_proc
      end
    }
    ThreadsWait.all_waits(*@threads)

    @courses
  end

    private
    def current_year
      (Time.now.month.between?(1, 7) ? Time.now.year - 1 : Time.now.year)
    end

    def current_term
      (Time.now.month.between?(2, 7) ? 2 : 1)
    end
    
end

